#
# TABLE STRUCTURE FOR: admin_login_log
#

DROP TABLE IF EXISTS admin_login_log;

CREATE TABLE `admin_login_log` (
  `id` bigint(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'This field contain a id for the Login Log! this is primary key of Table',
  `admin_id` int(10) unsigned DEFAULT NULL COMMENT 'This Field contain the Id of Admin Which is Currently Logged IN!',
  `login_time` varchar(15) DEFAULT NULL COMMENT 'This Field Contain the Time When Admin is Logged IN! ',
  `ip_address` varchar(45) DEFAULT NULL COMMENT 'This field contain the Ip Address of Machine using Which Admin got Login!',
  `agent_name` varchar(200) DEFAULT NULL COMMENT 'This Field Contain the Browser Name Using which Usesr is Accessing the Site! ',
  `os` varchar(45) DEFAULT NULL COMMENT 'This field contain the Os name and Version using which User is Accessing the Site!',
  `active` char(1) DEFAULT '1' COMMENT 'If entry is Active then.. this field will contain 1 otherwise 0.',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COMMENT='This table contain the Login logs of every Admin.. Login logs contain Ip useragent login time of user!';



#
# TABLE STRUCTURE FOR: admin_table
#

DROP TABLE IF EXISTS admin_table;

CREATE TABLE `admin_table` (
  `admin_id` bigint(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'this is id of admin and primary key of admin_table',
  `first_name` varchar(50) NOT NULL COMMENT 'first name of Admin',
  `last_name` varchar(50) NOT NULL COMMENT 'last name of Admin',
  `date_of_birth` varchar(15) NOT NULL COMMENT 'date of Birth of Admin',
  `age` int(3) NOT NULL COMMENT 'AGe of Admin',
  `email_id` varchar(60) NOT NULL COMMENT 'email id of Administrator',
  `password` varchar(50) NOT NULL COMMENT 'this field contain password of Admin',
  `active` char(1) NOT NULL DEFAULT '1' COMMENT 'if Active = 1 then Account is Active otherwise Deactive',
  PRIMARY KEY (`admin_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COMMENT='This table contain the details of Admin panel users.';



#
# TABLE STRUCTURE FOR: chemist_details
#

DROP TABLE IF EXISTS chemist_details;

CREATE TABLE `chemist_details` (
  `chemist_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'this field contain the Id of Chemist Registerd with Us',
  `chemist_first_name` varchar(45) NOT NULL COMMENT 'This field contain the First Name of Chemist',
  `chemist_last_name` varchar(45) NOT NULL COMMENT 'This field contain the last name of Chemist',
