  PRIMARY KEY (`chemist_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1 COMMENT='This Table contain the Detail of Registerd Chemist. with our site';



#
# TABLE STRUCTURE FOR: chemist_login
#

DROP TABLE IF EXISTS chemist_login;

CREATE TABLE `chemist_login` (
  `chemist_login_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'this is primary key of table for chemist login table.. when a chemist will get login this table will be used to give him Login! ',
