#
# TABLE STRUCTURE FOR: order_assign_table
#

DROP TABLE IF EXISTS order_assign_table;

CREATE TABLE `order_assign_table` (
  `assign_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'this column contain the Assign_id  for orders table.. after assign a order there would be a entry in this table. about more order details.',
  `order_id` bigint(10) unsigned NOT NULL COMMENT 'This Field Contain the Order Id from Orders Table.! for which the Order have been Assigned!',
  `chemist_id` int(10) unsigned NOT NULL COMMENT 'This column contain the Chemist Id.. to whome the order have been Assigned! ',
  `admin_remark` varchar(500) DEFAULT NULL COMMENT 'this column contain the remark done by Admin! at the time of accepting order & assign to chemist',
  `checked` char(1) DEFAULT '0' COMMENT 'this field contain the value 1 if.. the order Have been check by Chemist! \notherwise 0 default',
  `accepted` char(1) DEFAULT '0' COMMENT 'if Chemist Accept the Order this column would be 1 other wise default 0.',
  `approved` char(1) DEFAULT '0' COMMENT 'If chemist Accept a Order and... Then then Admin will Approve The Order to Display to Client!.. if Approved yes then field will contain 1 other wise its default 0',
  `bill_ammount` int(10) DEFAULT NULL COMMENT 'If Chemist Accept a Order and Genrate a Bill then this Field will contain total Bill Ammount',
  `deny_reasone` varchar(500) DEFAULT NULL COMMENT 'If Chemist deny an Order then this field will contain the Reasone of that!',
  `disapprove_reason` varchar(5000) DEFAULT NULL COMMENT 'If Admin Dissapprove a Chemists Offer, then this field will contain the Reasone of This!\nother wise this Field is Empty!',
  `admin_comment` varchar(500) DEFAULT NULL COMMENT 'When Admin Approve an Order.. then if He Add a Comment.. then This Field will Contain that.. Comment in It. other wise it will be null',
  `active` char(1) DEFAULT '1' COMMENT 'if Assign Id is Delted the value of Active will be 0 otherwise it would be 1',
  PRIMARY KEY (`assign_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1 COMMENT='This table contain the data of Assigned orders';



#
# TABLE STRUCTURE FOR: order_deny_reasone_admin
#

DROP TABLE IF EXISTS order_deny_reasone_admin;

CREATE TABLE `order_deny_reasone_admin` (
  `reasone_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'this is the primary key of table which contain the reasone id... Reasone is the Thing Which Describe. Why Admin Not Accepted the Order and Denied that',
  `order_id` bigint(10) unsigned NOT NULL COMMENT 'This field contain the Order Id which is Denied by Admin...',
  `reasone` varchar(500) NOT NULL COMMENT 'this field contain the reasone.. why admin denied a order',
  PRIMARY KEY (`reasone_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COMMENT='This table contain the reasone.. why Admin Dinied a order to be Placed.. or why Admin not Accepted the Order';



#
# TABLE STRUCTURE FOR: order_items
#

DROP TABLE IF EXISTS order_items;

CREATE TABLE `order_items` (
  `order_item_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'This field contain the Order Item Id.. ',
  `order_id` int(10) DEFAULT NULL COMMENT 'This field contain the order Id to which Item Have been Assigned!',
  `assign_id` int(10) DEFAULT NULL,
  `date` varchar(15) DEFAULT NULL COMMENT 'This field contain the Date. when chemist Created the Bill.. ',
  `medicine_type` varchar(45) DEFAULT NULL COMMENT 'This field contain the type of Medicine.. means injection,tablet,capsule etc...',
  `medicine_name` varchar(45) DEFAULT NULL COMMENT 'this field contain the Brandname or Medicine Name',
  `medicine_qty` int(11) DEFAULT NULL COMMENT 'This field contain the Quantity of a Medicine in a Order or Prescription written by Doc.',
  `medicine_price_unit` int(11) DEFAULT NULL COMMENT 'This field contan the Price of a Single Unit of Medicine!',
  `total` int(11) DEFAULT NULL COMMENT 'This field contain the Total of a Medicine.. fourmulaa is.. medicine_qty Multiply with Medicine_price_unit',
  `active` char(1) DEFAULT '1' COMMENT 'This field contain if the Item is Active or Not! By default Value is 1 otherwise it would be 0.',
  PRIMARY KEY (`order_item_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1 COMMENT='This table Contain the All items of All Orders.. with their Price details';



#
# TABLE STRUCTURE FOR: order_logs
#

DROP TABLE IF EXISTS order_logs;

CREATE TABLE `order_logs` (
  `order_log_id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT 'This field contain the id.. its primary key of table!',
  `order_id` varchar(45) DEFAULT NULL COMMENT 'This field containt the order id on which action have been performed',
  `designation` varchar(15) DEFAULT NULL COMMENT 'This field contain By Whome the Log have been Done, wheather client admin or Chemist!',
  `log_done_by` bigint(10) DEFAULT NULL COMMENT 'This field contain the id of person Who Made that Operation! ',
  `log_operation` varchar(100) DEFAULT NULL COMMENT 'This field contain the name of Log Operation! like Order placed! order updated order deleted Like entries!  ',
  `log_time` varchar(15) DEFAULT NULL COMMENT 'This field containt the timestamp when the operation have been performed',
  `active` char(1) DEFAULT '1' COMMENT 'if Log is Active then this field contain default value 1 otherwise it would be 0 ',
  PRIMARY KEY (`order_log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1 COMMENT='This table contain the Logs of all Orders! when they placed and time and other details of that!';



#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS orders;

CREATE TABLE `orders` (
  `order_id` bigint(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'this field contain order id.. its a numeric value for each order',
  `client_id` bigint(20) NOT NULL DEFAULT '0' COMMENT 'this field contain the Customer id which place the order',
  `patient_name` varchar(500) NOT NULL DEFAULT 'fake_patient' COMMENT 'this field contain the patient name for a specific order',
  `patient_age` int(3) NOT NULL DEFAULT '0' COMMENT 'this Field contain the Age of patient for which order is Given',
  `img_one` varchar(5000) DEFAULT NULL COMMENT 'this field contain the order image ones path',
  `img_two` varchar(5000) DEFAULT NULL COMMENT 'this field contain order image two',
  `img_three` varchar(5000) DEFAULT NULL COMMENT 'this field contain order image three',
  `img_four` varchar(5000) DEFAULT NULL COMMENT 'fourth image of order',
  `img_five` varchar(5000) DEFAULT NULL COMMENT 'fifth image of order',
  `remark` varchar(5000) DEFAULT NULL COMMENT 'this is the remark for order, if user want to enter it',
  `active` char(1) NOT NULL DEFAULT '1' COMMENT 'this field will contain 1 of order is Active when order deleted it would be set to 0',
  `checked` char(1) NOT NULL DEFAULT '0' COMMENT 'this field will be 1 when a Admin check the order.. other wise by default its 0. means still order not seen by admin',
  `accepted` char(1) NOT NULL DEFAULT '0' COMMENT 'if Admin Accept this Order then it would be 1 other wise zero',
  `assigned` char(1) DEFAULT '0' COMMENT 'if a order have been Assigned to a Chemist this field will be 1 other wise by default 0',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1 COMMENT='This Table Contain the list of all Orders';



#
