#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS users;

CREATE TABLE `users` (
  `user_id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT 'id of user..',
  `first_name` varchar(25) NOT NULL DEFAULT 'fake_user' COMMENT 'First name of user',
  `last_name` varchar(25) NOT NULL DEFAULT 'fake_user' COMMENT 'last name of user',
  `bday` date NOT NULL COMMENT 'Birthday of user',
  `age` int(3) NOT NULL COMMENT 'age of user..',
  `email_id` varchar(50) NOT NULL DEFAULT 'fake_user@fakemail.com' COMMENT 'email id of user...',
  `phone_no` bigint(10) NOT NULL DEFAULT '0' COMMENT 'phone no of user..',
  `signup_date` varchar(15) NOT NULL COMMENT 'signup time of user',
  `password` varchar(32) NOT NULL DEFAULT 'fake' COMMENT 'this is md5 dycrypteed password',
  `validation_hash` varchar(32) DEFAULT NULL COMMENT 'This field contain Validation Hash, its genrated when user Sign Up on Site',
  `Active` char(1) CHARACTER SET latin1 COLLATE latin1_bin NOT NULL DEFAULT '0' COMMENT 'if user is Active then 1 else 0',
  PRIMARY KEY (`user_id`),
  KEY `password` (`password`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT COMMENT='this table contain user details';



